import React from "react";

function Dashboard() {
  const mockUserData = {
    username: "testuser",
    email: "testuser@example.com",
    bio: "저는 기록을 좋아하는 사용자입니다."
  };

  return (
    <div style={{ padding: "20px", textAlign: "center" }}>
      <h1>환영합니다, {mockUserData.username}님!</h1>
      <p>Email: {mockUserData.email}</p>
      <p>소개: {mockUserData.bio}</p>
    </div>
  );
}

export default Dashboard;
